import { useState } from 'react';

const ProgressBar = () => {
    const [progress, setProgress] = useState(0);

    const increaseProgress = () => {
        if (progress < 100) {
            setProgress(progress + 10);
        }
    };

    const decreaseProgress = () => {
        if (progress > 0) {
            setProgress(progress - 10);
        }
    };

    return (
        <div>
            <div className="progress-bar" style={{ width: `${progress}%`, border: '1px black' }}></div>
            <button onClick={increaseProgress}>Incrementar</button>
            <button onClick={decreaseProgress}>Decrementar</button>
        </div>
    );
};

export default ProgressBar;
